

class Tile{
    constructor(x, y, tilesetX, tilesetY, size, type){
        this.x = x;
        this.y = y;
        this.tilesetX = tilesetX;
        this.tilesetY = tilesetY;
        this.size = size;
        this.type = type;
        this.originX = x;
        this.originY = y;
    }
     

    render(ctx, img){
        ctx.drawImage(img, this.tilesetX, this.tilesetY, this.size, this.size, this.x, this.y, this.size, this.size);
    }




}

